import React from "react";

function Dropdown() {
  return <div>Dropdown</div>;
  <button
    className="btn btn-secondary dropdown-toggle"
    type="button"
    data-bs-toggle="dropdown"
    aria-expanded="false"
  >
    Dropdown button
  </button>;
}

export default Dropdown;
